import { Injectable } from '@angular/core';
import { filter, map, Observable, of } from 'rxjs';
import { LandServiceInterface } from '../api-services/land.service';
import { SearchRequest } from '../common/app.model';
import { LandItemDto, LandSearchResponse } from '../common/land.model';

@Injectable()
export class LandMockService implements LandServiceInterface{

  constructor() { 
    console.log("using land mock service");
    
  }
  search(data: SearchRequest): Observable<LandSearchResponse> {
    const items: LandItemDto[]=[
      {
        code:'c123',
        coordinate: JSON.stringify([{x:12,y:23},{x:56,y:57},{x:67,y:89}]),
        description: 'Lahan untuk pembibitan tunas hasil modifikasi genom',
        id:1,
        n_region:3,
        name:'Lahan sorghum fuel',
        photo:null,
      },
      {
        code:'c101',
        coordinate: JSON.stringify([{x:12,y:23},{x:56,y:57},{x:67,y:89}]),
        description: 'Lahan untuk pengujian ketahanan varietas sorgum',
        id:1,
        n_region:4,
        name:'Lahan ketahanan sorgum fuel',
        photo:"data:image/png;base64, ",
      }
    ];

    const res: LandSearchResponse={
      data:items,
      nTotal:items.length
    }
    return of(res).pipe(map(x=>{
      x.data = x.data.filter(y=>y.name.includes(data.Search) || y.code.includes(data.Search));
      x.nTotal = x.data.length;
      return x;
    }));
  }
}
